let global_count = 0;

/**
 * Time complexity: 不知道是多少了，反正很慢
 * Space complexity: O(n * 13 * 13)
 * @param words
 */
function groupStrings(words: string[]): number[] {
  const states: number[] = words.map(word => {
    return Array
      .from(word, (char) => char.charCodeAt(0) - 97)
      .reduce((res, code) => res += (1 << code), 0);
  });

  const groupArr: [number[], Set<number>][] = [];

  states.forEach((state,index) => {
    // 有可能找到多个
    let find = [];

    for (let i = 0; i < groupArr.length; i++) {
      const [group, groupAssistSet] = groupArr[i];

      // 自己
      if (groupAssistSet.has(state)) {
        find.push(i);
        if (find.length === 1) {
          group.push(state);
          global_count++;
          //
          helper(groupAssistSet, state);
        }
      } else {
        // 自己的邻居
        for (let j = 0; j < 26; j++)
          if ((state & (1 << j)) !== 0)
            if (groupAssistSet.has((state ^ (1 << j)) | (1 << 27))) {
              find.push(i);
              if (find.length === 1) {
                group.push(state);
                global_count++;
                //
                helper(groupAssistSet, state);
              }
              break
            }
      }
    }

    if (find.length === 0) {
      const groupAssistSet = new Set<number>();
      groupArr.push([[state], groupAssistSet]);
      helper(groupAssistSet, state);
    } else if (find.length > 1) {
      const [group, groupAssistSet] = groupArr[find[0]];

      // 合并
      for (let i = find.length - 1; i > 0; i--) {
        const [x, y] = groupArr[find[i]];
        group.push(...x);
        global_count += x.length;
        Array.from(y.values()).forEach(key => groupAssistSet.add(key));

        // 从后往前删
        groupArr.splice(find[i], 1);
        // x.length = 0;
        // y.clear();
      }
    }
  });

  return [groupArr.length, Math.max(...groupArr.map(([group]) => group.length))];

  function helper(set: Set<number>, bitNum: number) {
    // self
    set.add(bitNum);

    // add or delete
    for (let i = 0; i < 26; i++) {
      set.add(bitNum ^ (1 << i));
    }

    // 广义邻居
    for (let i = 0; i < 26; i++)
      if ((bitNum & (1 << i)) !== 0)
        set.add((bitNum ^ (1 << i)) | (1 << 27));

    // // 狭义邻居
    // // replace to other
    // for (let i = 0; i < 26; i++) {
    //   if ((bitNum & (1 << i)) !== 0) {
    //     for (let j = 0; j < 26; j++) {
    //       if ((bitNum & (1 << j)) === 0)
    //         // set.add(bitNum - (1 << i) + (1 << j));
    //         set.add(bitNum ^ (1 << i) | (1 << j));
    //     }
    //   }
    // }
  }
}

