function groupStringsVersion2(words: string[]): number[] {
  const states: number[] = [];
  for (const word of words) {
    let state = 0;
    for (const char of word) {
      state |= 1 << (char.codePointAt(0)! - 97);
    }
    states.push(state);
  }

  const uf = useUnionFindMap<number>(states);
  const statesSet = new Set<number>(states);

  for (const state of states) {
    for (let i = 0; i < 26; i++) {
      const addOrRemove = state ^ (1 << i);
      if (statesSet.has(addOrRemove))
        uf.union(state, addOrRemove);

      // // 替换：广义邻居；*用1<<27表示
      // if ((state >> i) & 1) {
      //   const replace = (state ^ (1 << i)) | (1 << 27);
      //   uf.union(state, replace);
      // }


      // 替换：狭义邻居
      if ((state & (1 << i)) !== 0)
        for (let j = 0; j < 26; j++)
          if ((state & (1 << j)) === 0)
            // set.add(bitNum - (1 << i) + (1 << j));
            uf.union(state, state ^ (1 << i) | (1 << j));
    }
  }

  const groupCounter = new Map<number, number>();
  for (const state of states) {
    const root = uf.find(state);
    groupCounter.set(root, (groupCounter.get(root) ?? 0) + 1);
  }
  // @ts-ignore
  return [uf.getCount(), Math.max(...groupCounter.values())];
}

/**
 *
 * @param iterable  元素类型为T的数组，用于初始化并查集
 * @description
 * 更加通用的并查集写法，调用add手动添加或union自动添加
 */
function useUnionFindMap<T = unknown>(iterable?: T[]) {
  let count = 0; // 连通分量个数
  const parent = new Map<T, T>();
  const rank = new Map<T, number>(); // 各个帮派的大小
  for (const key of iterable ?? []) {
    add(key);
  }

  function add(key: T): boolean {
    if (parent.has(key))
      return false;

    parent.set(key, key);
    rank.set(key, 1);
    count++;
    return true;
  }

  // 如果key不在并查集，会自动add
  function find(key: T): T {
    if (!parent.has(key)) {
      add(key);
      return key;
    }

    while (parent.has(key) && parent.get(key) !== key) {
      let p = parent.get(key)!;
      // 进行路径压缩
      p = parent.get(p)!;
      key = p;
    }
    return key;
  }

  function union(key1: T, key2: T): boolean {
    let root1 = find(key1);
    let root2 = find(key2);
    if (root1 === root2) return false;
    if (rank.get(root1)! > rank.get(root2)!) {
      ;[root1, root2] = [root2, root1];
    }
    // rank优化: 总是让大的根指向小的根
    // 翻译：两帮派合并时，小帮派合并入大帮派
    // rank在这里不是深度的意思，而是帮派人数多少的意思
    parent.set(root1, root2);
    rank.set(root2, rank.get(root1)! + rank.get(root2)!);
    count--;
    return true;
  }

  function isConnected(key1: T, key2: T): boolean {
    return find(key1) === find(key2);
  }

  function getCount(): number {
    return count;
  }

  function getParent(): Map<T, T> {
    return parent;
  }

  function getRank(): Map<T, number> {
    return rank;
  }

  function getRoots(): T[] {
    const res = new Set<T>();
    // @ts-ignore
    for (const key of parent.keys()) {
      const root = find(key);
      res.add(root);
    }
    // @ts-ignore
    return [...res];
  }

  return {add, union, find, isConnected, getCount, getRank, getRoots, getParent};
}

